SELECT T1.*, T2.*
FROM   customers AS T1 LEFT JOIN cards AS T2 ON T1.customer_id = T2.customer_id
WHERE  T1.customer_id = :cid AND ( LOWER(T2.status) LIKE 'active' );

SELECT T1.*, T2.*
FROM   customers AS T1 LEFT JOIN cards AS T2 ON T1.customer_id = T2.customer_id
WHERE  T1.customer_id = :cid AND ( T2.annual_fee IS NOT NULL );
